import React from "react";
import ReactDOM from "react-dom/client";

import App from "./App";

const root = ReactDOM.createRoot(document.getElementById("root"));
const promptMessage = document.createElement("div");
promptMessage.innerHTML = "提示訊息：這是我的網站，歡迎光臨！";
document.body.insertBefore(promptMessage, document.body.firstChild);
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

